<input type="text" className="form-control" value={getPass} onChange={(e) => setPass(e.target.value)}/>
</div>

<div className="col-58"><button  id="Popover1" type="submit" className="button1" data-bs-toggle="popover"  data-bs-content="Some content inside the popover">Submit</button></div>
